message:
#PeloBrasil 

Senhor, quem habitará no teu santuário?
Quem poderá morar no teu santo monte? Aquele que é íntegro em sua conduta e pratica o que é justo; que de coração fala a verdade e não usa a língua para difamar; que nenhum mal faz ao seu semelhante
e não lança calúnia contra o seu próximo." - Salmos 15:1-3 🙏🏻✝️

